import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import ReactDOM from 'react-dom';


class Names extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      names: ["Adilet","Asan","Alex"]
    }
  }
  render(){
    return <div>
          <Name />
          </div>
  }
}
 let Name = (props) => {
   return (
     <>
           {props.data.map(el => {
             return <div> {el.names}</div>;
           })}
     </>
   );

 }



let App = () => (
                <div>
                  <Names/>
                </div>
              );


ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
